@jhooperphotography surprised me with an amazing Christmas present of this beautiful portrait of us painted by @dominic.draws ! He requested the style be done in Tyrus Wong inspired style which I think Dominic nailed!! I truly love it. Thank you so much to both of you!! I shared the iterations as well because I thought it was so cool to see the progression from a more Disney style to a more Tyrus Wong style. 
.
This day is special because it’s the day he asked me out. It embodies everything we love- adventure, nature and good times :) more than two years going strong, and many more to come :)
